tables.table_schema:
CREATE TABLE patient_outcomes (
    patient_id UUID,
    treatment_id UUID,
    outcome_status VARCHAR(50),
    survival_days INT
);

CREATE TABLE treatments (
  treatment_id UUID PRIMARY KEY,
  treatment_name VARCHAR
);

CREATE TABLE treatments (
  id INT PRIMARY KEY,
  treatment_name VARCHAR(100),
  duration INT,
  cost DECIMAL(10, 2)
);

CREATE TABLE outcomes (
  id INT PRIMARY KEY,
  patient_id INT,
  outcome_type VARCHAR(50),
  outcome_description TEXT
);

CREATE TABLE survival_rates (
  id INT PRIMARY KEY,
  patient_id INT,
  survival_rate DECIMAL(5, 2),
  survival_period VARCHAR(50)
);

CREATE TABLE treatment_strategies (
   strategy_id INT PRIMARY KEY,
   strategy_name VARCHAR(50),
   description TEXT
);
